import React, { Component } from 'react';
import imageUrl from '../../assets/images/book.png';
import Article  from '../../components/Article/article';

class Shop extends Component{

    state= {
            cx: [
                {
                    title: 'Book',
                    price: '2$',
                    description: 'THis is a nice book!',
                    imageUrl: imageUrl,
                    userId: 1
                }
            ]
    }

    render(){
        if(!this.state.products){
            return (
                <h1>No Products Found!</h1>
            )
        }

        let products ;
        product = this.state.products.map(art=>{
           return( <Article
             title={art.title} 
             price={art.price}  
             description={art.description}
             imageUrl={art.imageUrl}
             userId={art.userId}/>)
        })
        return (
        <div class="grid">{products}  </div> 
    )

    }
    
}

export default Shop;
